import React, { useState, useEffect } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import "../styles/global.css";

export default function InterviewSetup() {
  const [darkMode, setDarkMode] = useState(false);
  const [topic, setTopic] = useState("");

  useEffect(() => {
    document.body.classList.toggle("dark-mode", darkMode);
  }, [darkMode]);

  return (
    <>
      <Navbar darkMode={darkMode} setDarkMode={setDarkMode} />
      <main className="form-page">
        <h1>Setup Interview</h1>
        <form className="setup-form">
          <label>Interview Topic</label>
          <input type="text" value={topic} onChange={(e) => setTopic(e.target.value)} placeholder="e.g. Data Structures" />

          <label>Duration (minutes)</label>
          <input type="number" placeholder="30" />

          <label>Difficulty</label>
          <select>
            <option>Easy</option>
            <option>Medium</option>
            <option>Hard</option>
          </select>

          <button type="submit" className="cta-btn">Start Interview</button>
        </form>
      </main>
      <Footer />
    </>
  );
}
